import React from 'react'
import Search from './Components/Search';
import Results from './Pages/Results/Results';
import newLocal from './Pages/newLocal/newLocal';
import Home from './Pages/Home/Home';
import Local from './Pages/Local/Local';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import { geolocated } from "react-geolocated";
import axios from 'axios';
class App extends Component {
  constructor(props) {

  }
  componentDidMount() {
    var zip = this.props.coords ? [this.props.coords.latitude, this.props.coords.longitude] : "no location found";
        console.log(zip);
    axios.get('https://maps.googleapis.com/maps/api/geocode/json?address=1600+Amphitheatre+Parkway,+Mountain+View,+CA&key=AIzaSyC0gsrJf3UG_brzh_7F0YmHyZK7O2iZZvE')
    .then((response)=>{console.log(response.data)})
  }
  render(){
    return (
      <Router>
        <Search/>
        <Switch>
          <Route exact path={"/"} component={Home}/>
          <Route path={"/search"} component={Results}/>
          <Route path={"/local"} component={Local}/>
          <Route path={"/create-local"} component={newLocal}/>
        </Switch>
      </Router>
    )
  }
}

export default geolocated({
  positionOptions: {
      enableHighAccuracy: false,
  },
  userDecisionTimeout: 5000,
})(App);
